import React, { useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import "../../styles/DeccanChroniclesBooking.css";

const DeccanChroniclesBooking = () => {
  const location = useLocation();
  const navigate = useNavigate();

  // Retrieve size, price, and ad space ID from navigation state
  const { size, price, spaceId, newspaperId, newspaperName, userId, email } = location.state || {};

  // Form States
  const [adTitle, setAdTitle] = useState("");
  const [adContent, setAdContent] = useState("");
  const [category, setCategory] = useState("Jobs");
  const [duration, setDuration] = useState(1);
  const [totalPrice, setTotalPrice] = useState(price || 0);

  // Update total price when duration changes
  useEffect(() => {
    setTotalPrice((price || 0) * duration);
  }, [duration, price]);

  // Handle Ad Booking (Send to Database)
  const handleBooking = async () => {
    if (!adTitle || !adContent) {
      alert("Please fill in all fields.");
      return;
    }

    try {
      const response = await fetch("http://localhost:5000/api/ad-booking/book", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({
          userId,
          newspaperId,
          spaceId,
          title: adTitle,
          content: adContent,
          category,
          duration,
          price: totalPrice,
          newspaperName,
          email,
        }),
      });

      const result = await response.json();

      if (response.ok) {
        alert(`Ad booked successfully for ${duration} day(s) at â‚¹${totalPrice}!`);
        navigate("/"); // Redirect to Home after booking
      } else {
        alert(result.message || "Booking failed. Try again.");
      }
    } catch (error) {
      console.error("Error booking ad:", error);
      alert("Error occurred during booking.");
    }
  };

  return (
    <div className="deccan-booking">
      <div className="booking-card">
        <h1 className="newspaper-title">Deccan Chronicles</h1>
        <p className="subtitle">Your Trusted Daily Newspaper</p>

        <h2 className="section-title">Classified Ads Booking</h2>

        <div className="form-group">
          <label>Ad Title:</label>
          <input
            type="text"
            value={adTitle}
            onChange={(e) => setAdTitle(e.target.value)}
            placeholder="Enter your ad title"
          />
        </div>

        <div className="form-group">
          <label>Ad Content:</label>
          <textarea
            value={adContent}
            onChange={(e) => setAdContent(e.target.value)}
            placeholder="Write your ad content here..."
          />
        </div>

        <div className="form-group">
          <label>Category:</label>
          <select value={category} onChange={(e) => setCategory(e.target.value)}>
            <option value="Jobs">Jobs</option>
            <option value="Real Estate">Real Estate</option>
            <option value="Services">Services</option>
            <option value="Announcements">Announcements</option>
          </select>
        </div>

        <div className="form-group">
          <label>Project Duration (in days):</label>
          <input
            type="number"
            value={duration}
            onChange={(e) => setDuration(Math.min(10, Math.max(1, e.target.value)))}
            min="1"
            max="10"
            placeholder="Enter number of days (Max 10)"
          />
        </div>

        <p><strong>Total Price:</strong> â‚¹{totalPrice}</p>

        <button className="book-ad-button" onClick={handleBooking}>
          Book Ad
        </button>
      </div>
    </div>
  );
};

export default DeccanChroniclesBooking;
